var tipuesearch = {"pages": [{'title': 'Weeks', 'text': 'week2-5 \n week6-9 \n week10-14 \n week15-18 \n', 'tags': '', 'url': 'Weeks.html'}, {'title': 'Week2-5', 'text': 'week2 \n 建立個人倉儲和網站 \n 先登入github，將自己的cad2019倉儲建立起來，把201906_fall可攜系統載到隨身碟上，將自己的倉儲git clone到隨身碟上，以 git submodule add\xa0 https://github.com/mdecourse/cmsimde \xa0cmsimde建立 cmsimde 目錄，把up_dir裡的東西複製到cad2019資料夾，切換到cmsimde的目錄下， 以 python wsgi.py 啟動近端網際伺服器，動態內容編輯完成後, 以 generate_pages 轉為靜態內容, 以 git add commit 及 push 將內容推到遠端. \n 然後到github上，setting的github pages上，切換到master branch，建立起自己的網站。 \n \n week3 \n solvespace編譯 \n 1.將Y:\\portablegit\\bin\\sh.exe 改名為 sh_rename_for_solvespace.exe  2.git clone --recurse-submodules https://github.com/solvespace/solvespace.git solvespace 3.edit Y:\\tmp\\solvespace\\extlib\\angle\\CMakeLists.txt comment out line 713 and 714 #list(APPEND ANGLE_DEFINITIONS #"-DANGLE_PRELOADED_D3DCOMPILER_MODULE_NAMES={ \\"d3dcompiler_47.dll\\", \\"d3dcompiler_46.dll\\", \\"d3dcompiler_43.dll\\" }") endif() 4.接著需要手動進行 libpng.dll.a 的編譯, 並改名為 libpng_static.a, 並放到編譯系統的 lib 目錄中 (即隨身系統的 msys64\\mingw64\\lib 目錄): 5.cd solvespace 6.cd extlib 7.cd libpng 8.mkdir build 9.cd build 10.cmake .. -G "MinGW Makefiles" -DCMAKE_BUILD_TYPE=Release 11.mingw32-make 12.接著回到 solvespace 原始碼目錄, 建立 build 目錄後進入 build 目錄, 執行: 13.cmake .. -G "MinGW Makefiles" -DCMAKE_BUILD_TYPE=Release 14.mingw32-make \n \n week4 \n --更新網站-- \n --錄影片所需軟體-- \n \n \xa0 1.\xa0 \xa0\xa0 \xa0 \xa0 \xa0Share-X 用來錄製影片及擷取圖片 \n \n \xa0 2.\xa0 \xa0 \xa0 \xa0 Aegisub 用來上影片字幕 \n \n \xa0 3.\xa0\xa0 \xa0 \xa0Arctime 用來影片跟字幕合併及上浮水印 \n --------------------------------------------------------------------------- \n 自己的浮水印 \n \n week5 \n --solve space操作-- \n 我做的題目是第9個影片，將solve space圖檔匯入到網頁上。 \n \n 操作影片: \n \n', 'tags': '', 'url': 'Week2-5.html'}, {'title': 'Week6-9', 'text': 'week6 \n 1.參數化零組件繪製 \n 成品圖: \n \n \n 2.網際 V-rep 模型控制 \n \n 3.新增啟動與停止按紐 \n \n week7 \n 把solvespace的about編譯成自己的學號 \n \n \n solvespace繪圖驗證1 \n \n 編號1 \n solvespace繪圖驗證3 \n \n 編號3 \n \n week8 \n 啟用 CMSiMDE 中的網誌系統 \n \n 開始導入webots \n \n 以ssh對github連線 \n \n week9 \n \n', 'tags': '', 'url': 'Week6-9.html'}, {'title': 'Week10-14', 'text': 'week10 \n 加入組長建立好的倉儲 \n 下載NX3和NX12並修改步驟 \n \n', 'tags': '', 'url': 'Week10-14.html'}, {'title': 'Week15-18', 'text': '', 'tags': '', 'url': 'Week15-18.html'}, {'title': 'Note', 'text': '\n', 'tags': '', 'url': 'Note.html'}, {'title': 'Solidworks', 'text': '1993年，創始人Jon Hirschtick招募了一個工程師團隊，旨在使3D CAD軟體更容易上手。Hirschtick從廣受好評的麻省理工學院二十一點隊的成員中籌得100萬美元，開始了他的新事業。該團隊的目標是構建一個基於Windows平台的易於使用且價格合理的軟體。 \n 2005年 \n \n 繪圖比較，為用戶提供工具來比較兩個圖紙之間的變化。 \n Flex功能。 \n 電氣布線，與管道布線一起使用。 \n 在圖紙中自動標註，以捕捕捉模型中已定義的尺寸。 \n 能夠繪製無限的線條。 \n SolidWorks Rx發布，旨在提供幫助技術支持更好地去識別問題。 \n \n 2006年 \n \n 發布Smart Components功能，允許為硬體之類的物件安裝智能裝配組件。 \n 介紹填充圖案。 \n 介紹草圖塊。 \n 顯示狀態。 \n 設計檢查器，允許用戶根據公司標準動態檢查他們的模型。 \n 添加了相機視圖功能。 \n 發布SolidWorks Office Premium（白金版）軟體包，包括Routing，COSMOSWorks和 COSMOSMotion進行模擬，以及ScanTo3D。 \n \n 2007年 \n \n SWIFT工具可幫助設計人員在提供自動化解決方案時動態了解模型存在問題或錯誤的原因。 \n 可在組件中使用皮帶，鏈條和齒輪功能。 \n 用於表面處理的自由形式命令。 \n 介紹Enterprise PDM。 \n \n 2008年 \n \n \n 使用新的菜單欄和CommandManager布局對用戶介面進行全面檢修和現代化優化。上下工具欄和快捷工具欄首次可用。所有這些介面組件現在都可以完全自定義。 \n Instant3D，提供拖動和操縱幾何體的功能，可輕鬆測試不同的設計概念。 \n 發布TolAnalyst。 \n 設計剪貼畫，通過剖析現有數據以便在另一個模型中重複使用，可以更輕鬆地重用現有的2D和3D數據。 \n 推出DriveWorksXpress和DFMXpress。 \n \n 2009年 \n \n PhotoView360圖像渲染作為第一個渲染器引入，以訪問處理器的多核功能。 \n SpeedPak現在可用於簡化裝配中的組件。 \n 為追求更高目標，所以引入傳感器。 \n CircuitWorks發布並添加到SolidWorks Office Premium（白金版）軟體包中。 \n 發布3DVIA Composer。 \n \n 2010年 \n \n 現在提供可持續發展方案，幫助用戶了解其設計對環境的影響。 \n 快速標註尺寸使得創建細節圖更加容易。 \n 介紹基於事件的運動模擬。 \n 首次提供滑鼠手勢快捷鍵。 \n 現在可以進行多體鈑金建模。 \n \n 2011年 \n \n PhotoView360完全集成到SolidWorks介面中。 \n 現在可以使用Walk-through（走查）功能。 \n 引入了Defeature工具以幫助限制模型中的智慧財產權數量。 \n 現在可以在Simulation中使用平面簡化。 \n 自動排列圖紙中的尺寸。 \n \n 2012年 \n \n 方程式編輯器經過徹底檢修後，更加用戶友好。 \n 介紹Large Design Review。 \n Feature Freeze現在可以讓用戶更好地控制性能。 \n 鈑金增強：邊線法蘭的更多選擇，引入掃描法蘭，使用的成型工具更加人性化。 \n 發布成本計算加載項。 \n \n 2013年 \n \n View Orientation有一個對話框，不再只是在工具欄上了。還引入了選擇器多維數據集以及保存視圖功能以便之後使用。 \n 以前的版本文件互操作性：2013文件現在可以在2012 SP5中打開。 \n 介紹Conic草圖實體。 \n 相交功能。 \n Customer Portal（客戶門戶網站）上提供了CAD Admin Dashboard（CAD管理員儀錶板）。 \n \n 2014年 \n \n 能夠通過上下工具欄快捷方式添加標準配合。 \n 替換草圖實體使用戶能夠用新的實體替換舊實體並仍然維護下游引用。 \n 推出了鈑金中的Lofted Bend功能。 \n 能夠創建Conic Fillets（圓錐倒角）。 \n 樣式樣條草圖命令。 \n 自動縮放第一個草圖。現在，在草圖上創建第一個維度時，所有實體都會自行調整大小以進行縮放。 \n 能夠配置結構成員配置文件。現在允許配置輪廓草圖，這大大改變了需要組織的文件數量。 \n MySolidWorks作為能夠提供自學培訓以及所有SolidWorks的在線資源社區發布。 \n \n 2015年 \n \n \n 動態參考可視化，幫助用戶了解父/子關聯。 \n 引入了選擇集，以便於重複使用幾何選擇組合。 \n 能夠直接從SolidWorks進行3D列印。 \n Simulation中的疲勞分析。 \n Profile center mate（輪廓中心配合）。 \n 發布SolidWorks MBD。 \n \n 2016年 \n \n 用戶介面重新設計，包括更好地支持高解析度顯示器。 \n 藍色/灰色盤默認採用傳統配色方案。 \n 引入了選擇麵包屑，使相關命令更易於訪問。 \n 實現Mate Controller工具，以更加可訪問的方式捕捉裝配定位。 \n 能夠全局替換失敗的配合實體。 \n 介紹Thread功能。 \n 發布PDM Standard（標準版）並添加到SolidWorks Professional專業版軟體包中。 \n SolidWorks Visualize作為獨立的圖片渲染應用程式發布。 \n \n 2017年 \n \n 引入3D互連以簡化不同文件類型與SolidWorks的協作。 \n Asset Publisher具有ground plane（地層）和magnetic mates（磁配對），可輕鬆實現大型裝配布局。 \n 引入了Advanced Hole（高級孔）功能。 \n 增強了Wrap功能，可在更多類型的面選擇上創建幾何體。 \n 陰影草圖輪廓增強選擇和操作功能。 \n \n 2018年 \n \n SolidWorks啟動時的歡迎對話框。 \n 用戶設置現在可以登錄。新發布的在線許可也可以遵循此登錄，在需要在多台計算機上使用SolidWorks時為用戶提供另一種選擇。 \n 選擇幾何圖形，允許用戶忽略幾何圖形並在其上選擇其他實體。 \n 引入了標籤和插槽功能，自動執行以前在鈑金和焊件中常用的手動方法。 \n 能夠鏡像3D草圖中的實體。 \n 首次使用筆，觸屏和基於手勢的草圖繪製功能。 \n 引入拓撲仿真分析。 \n \n 2019年 \n \n 顯著改進裝配性能。 \n Silhouette defeature命令，簡化了從模型中刪除細節以提高性能或保護智慧財產權的過程。 \n 能夠按狀態對mates進行分組。 \n 部分倒角和圓角。 \n 將圖像轉換為網格/凹凸貼圖，從圖像文件創建實際的3D幾何體。 \n \n \n', 'tags': '', 'url': 'Solidworks.html'}, {'title': 'NX', 'text': '1960年，McDonnell Douglas Automation 公司成立。 1976年，收購了Unigraphics CAD/CAE/CAM系統的開發商——United Computing公司，UG的雛形問世。 1983年，UG 上市。 \n 1986年，Unigraphics吸取了業界領先的、為實踐所證實的實體建模核心——Parasolid的部份功能。 1989年，Unigraphics宣布支持UNIX平台及開放系統的結構，並將一個新的與STEP標準兼容的三維實體建模核心Parasolid引入UG。 1990年，Unigraphics作為McDonnell Douglas（波音飛機公司）的機械CAD/CAE/CAM的標準。 1991年，Unigraphics開始了從CAD/CAE/CAM大型機版本到工作站版本的轉移。 1993年，Unigraphics引入複合建模的概念，可以實體建模、曲線建模、框線建模、半參數化及參數化建模融為一體。 1995年，Unigraphics首次發布了Windows NT版本。 1996年，Unigraphics發布了能自動進行干涉檢查的高級裝配功能模塊、最先進的CAM模塊以及具有A類曲線造型能力的工業造型模塊：它在全球迅猛發展，占領了巨大的市場份額，已經成為高端及商業CAD/CAE/CAM應用開發的常用軟體。 1997年，Unigraphics新增了包括WAVE（幾何連結器）在內的一系列工業領先的新增功能。WAVE這一功能可以定義、控制、評估產品模板，被認為是在未來幾年中業界最有影響的新技術。 2000年，Unigraphics發布了新版本的UG17，最新版本的，是UGS成為工業界第一個可以裝載包含深層嵌入「基於工程知識」（KBE）語言的世界級MCAD軟體產品的供應商。 2001年，Unigraphics發布了新版本UG18，新版本對舊版本的對話框進行了調整，使得在最少的對話框中能完成更多的工作，從而簡化了設計。 2002年，Unigraphics發布了 UG NX1.0 .新版本繼承了UG18的優點，改進和增加了許多功能，使其功能更強大，更完美。 2003年，Unigraphics發布了新版本 UG NX2.0 \xa0 。新版本基於最新的行業標準，它是一個全新支持PLM的體系結構。EDS公司同其主要客戶一起，設計了這樣一個先進的體系結構，用於支持完整的產品工程。 2004年，Unigraphics發布了新版本的 UG NX3.0 ，它為用戶的產品設計與加工過程提供了數字化造型和驗證手段，。它針對用戶的虛擬產品的設計和工藝設計的需要，提供經過實踐驗證的解決方案。 2005年，Unigraphics發布了新版本的 UG NX4.0 .它是嶄新的NX體系結構，使得開發與應用更加簡單和快捷。 \n 2007年04月， UGS公司發布了 NX 5.0 \xa0 – NX的下一代數字產品開發軟體，幫助用戶以更快的速度開發創新產品，實現更高的成本效益。 2008年06月，Siemens PLM Software發布 UG NX 6.0 ，建立在新的同步建模技術基礎之上的NX 6將在市場上產生重大影響。同步建模技術的發布標誌著NX的一個重要里程碑，並且向MCAD市場展示Siemens的鄭重承諾。 NX 6將為我們的重要客戶提供極大的生產力提高。 2009年10月 – 西門子工業自動化業務部旗下機構、全球領先的產品生命周期管理（PLM）軟體與服務提供商Siemens PLM Software 宣布推出其旗艦數字化產品開發解決方案NX 軟體的最新版。 UG NX 7.0 引入了「HD3D」（三維精確描述）功能，即一個開放、直觀的可視化環境，有助於全球產品開發團隊充分發掘PLM信息的價值，並顯著提升其制定卓有成效的產品決策的能力。此外，NX 7.0還新增了同步建模技術的增強功能。修復了很多6.0所存在的漏洞，穩定性方面較6.0有很大的提升。 2010年5月20日– Siemens PLM Software在上海世博會發布了功能增強的NX7最新版本（ UG NX 7.5 ），NX GC 工具箱將作為NX 7最新版本的一個應用模塊與NX 7一起同步發布。NX GC 工具箱是為滿足中國用戶對NX特殊需求推出的本地化軟體工具包。在符合國家標準（GB）基礎上，NX GC 工具箱做了進一步完善和大量的增強工作。 2011年09月 - Siemens PLM Software發布了 UG NX 8.0 2012年10月 - Siemens PLM Software發布了 UG NX 8.5 2013年10月- Siemens PLM Software發布了 UG NX 9.0 2014年8月- Siemens PLM Software發布了 UG NX 10.0 2016年8月- Siemens PLM Software發布了 UG NX 11.0 2017年10月- Siemens PLM Software發布了 UG NX 12.0', 'tags': '', 'url': 'NX.html'}, {'title': 'Inventor', 'text': '', 'tags': '', 'url': 'Inventor.html'}, {'title': 'Creo', 'text': '', 'tags': '', 'url': 'Creo.html'}, {'title': 'About', 'text': '此內容管理系統以\xa0 https://github.com/mdecourse/cmsimde \xa0作為 submodule 運作, 可以選定對應的版本運作, cmsimde 可以持續改版, 不會影響之前設為 submodule, 使用舊版 cmsimde 模組的內容管理相關運作. \n 利用 cmsimde 建立靜態網誌方法: \n 1. 在 github 建立倉儲, git clone 到近端 \n 2. 參考\xa0 https://github.com/mdecourse/newcms , 加入除了 cmsimde 目錄外的所有內容 \n 以 git submodule add\xa0 https://github.com/mdecourse/cmsimde \xa0cmsimde \n 建立 cmsimde 目錄, 並從 github 取下子模組內容. \n 3.在近端維護時, 更換目錄到倉儲中的 cmsimde, 以 python wsgi.py 啟動近端網際伺服器. \n 動態內容編輯完成後, 以 generate_pages 轉為靜態內容, 以 git add commit 及 push 將內容推到遠端. \n 4. 之後若要以 git clone 取下包含 submodule 的所有內容, 執行: \n git clone --recurse-submodules  https://github.com/mdecourse/newcms.git \n', 'tags': '', 'url': 'About.html'}, {'title': 'Develop', 'text': 'https://github.com/mdecourse/cmsimde \xa0的開發, 可以在一個目錄中放入 cmsimde, 然後將 up_dir 中的內容放到與 cmsimde 目錄同位階的地方, 使用 command 進入 cmsimde 目錄, 執行 python wsgi.py, 就可以啟動, 以瀏覽器 https://localhost:9443\xa0就可以連接, 以 admin 作為管理者密碼, 就可以登入維護內容. \n cmsimde 的開發採用 Leo Editor, 開啟 cmsimde 目錄中的 cmsimde.leo 就可以進行程式修改, 結束後, 若要保留網際內容, 只要將 cmsimde 外部的內容倒回 up_dir 目錄中即可後續對 cmsimde 遠端倉儲進行改版. \n init.py 位於\xa0 up_dir 目錄, 可以設定 site_title 與 uwsgi 等變數.', 'tags': '', 'url': 'Develop.html'}]};